import React, { useState, useEffect } from 'react';
import tokenAPI from '../services/apikiApi';

const HomePage = () => {
  const [Post, setPost] = useState([]);
  useEffect(() => {
    tokenAPI().then((resp) => {
      setPost(resp);
    });
  }, []);
  return (
    <section>
      {Post.map((Post) => (
        <div>{Post._embedded["wp:featuredmedia"][0].title}</div>
      ))}
    </section>
  );
};

export default HomePage;
